import React from 'react';

const Project = (props) => {
    return(
         <div className='bg-navy vh-75-l fl w-100 w-50-l pa3 dib ' > 
                <div className='h3'>
                    <img alt='Photo' src='https://matlabprojects.org/wp-content/uploads/2018/12/Project-Topics-for-Computer-Engineering-Diploma-1024x625.jpg' />
                </div>
                <div className="h-75-l">
                    <h2 className='light-blue '>{props.title}</h2>
                    <p className='washed-blue'>{props.summary}</p>
                    <a href={props.github} >GitHub</a>
                </div>
        </div>
    );
}

export default Project;
